// src/About.js
import React from 'react';
import '..components/About'; // Optional: for styling

const About = () => {
  return (
    <div className="about-section">
      <h2>About Us</h2>
      <p>
        Welcome to our company! We are dedicated to providing the best service possible. Our team is composed of experienced professionals who are passionate about what they do.
      </p>
      <p>
        Our mission is to deliver high-quality products that meet the needs of our customers. We believe in innovation, integrity, and excellence.
      </p>
      <p>
        Thank you for choosing us. We look forward to working with you!
      </p>
    </div>
  );
};

export default About;
